import React from "react";
import golf from "./golf1.jpg";

function Hero() {
  return (
    <div className="relative top-0">
      <div className="w-full h-full flex flex-col absolute top-0 left-0 justify-center items-left md:items-center">
        {/*Container*/}
        <div className="h-1/2 bg-blue-800">
          {/*Heading*/}
          <div className="text-4xl font-bold text-white md:text-6xl sm:text-4xl">
            The new e-Golf
          </div>
          {/*Text*/}
          <div className="text-lg sm:text-md text-white">Hello bottom text</div>
        </div>
      </div>
      {/*Image*/}
      <img src={golf} alt="The all new e-Golf" />
    </div>
  );
}

export default Hero;
